class SupportModel {
  int? _status;
  String? _message;
  int? _messageCode;
  List<Pages>? _pages;

  int? get status => _status;

  String? get message => _message;

  int? get messageCode => _messageCode;

  List<Pages>? get pages => _pages;

  SupportModel({int? status, String? message, int? messageCode, List<Pages>? pages}) {
    _status = status;
    _message = message;
    _messageCode = messageCode;
    _pages = pages;
  }

  SupportModel.fromJson(dynamic json) {
    _status = json['status'];
    _message = json['message'];
    _messageCode = json['message_code'];
    if (json['pages'] != null) {
      _pages = [];
      json['pages'].forEach((v) {
        _pages?.add(Pages.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map['status'] = _status;
    map['message'] = _message;
    map['message_code'] = _messageCode;
    if (_pages != null) {
      map['pages'] = _pages?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

